INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1785, 2177, 'Phenytoin', 'Phenytoin bioavailability may decrease to subtherapeutic levels when the suspension is given concomitantly with enteral feedings.  The mechanism may be related to phenytoin binding to substances in the enteral formula (e.g., calcium, protein) and/or binding to the tube lumen.', 'food', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
